import "./bottom.css";
import one from "../assets/images/down1.jpg";
import two from "../assets/images/down2.jpg"
function Bottom(){
    return(
        <div className="btm-main-div">
            <div className="btm-first">
            <img src={one} width="150px"></img>
            </div>
            <div className="btm-second">

            </div>
        </div>
    )
}
export default Bottom;
